import React from "react";


const StudentList = ({ students }) => {
  return (
    <div>
      <h2>Student List</h2>
      <ul>
        {students.length === 0 ? (
          <p>No students added yet.</p>
        ) : (
          students.map((student, index) => (
            <li
              key={index}
              style={{
                display: "flex",
                gap: "10px",
                textAlign: "center",
              }}
            >
              <span>{student.name}</span>
              <span>{student.course}</span>
            </li>
          ))
        )}
      </ul>
    </div>
  );
};


export default StudentList;
